style.css:
::-webkit-scrollbar {
    width: 12px;
}

::-webkit-scrollbar-thumb {
    background-color: #3498db; /* Color of the scrollbar */
    border-radius: 6px;
}

::-webkit-scrollbar-track {
    background-color: #f0f0f0; /* Background color of the scroll bar track */
}
@-moz-document url("https://docs.google.com/") {
body {
		background-color: black !important;
	}
}
